import React from 'react';

const Example = () => {
  return (
    <>
      <style>
        {`
          .container {
            display: flex;
            justify-content: space-between;
          }

          .image-container {
            width: 40%;
          }

          .text-container {
            width: 50%;
            text-align: center;
          }

          img {
            border-radius: 20%;
            max-width: 100%;
            height: auto;
          }

          h1, p {
            color: white; /* Added to make text white */
          }

          @media screen and (max-width: 768px) {
            .container {
              flex-direction: column;
            }

            .image-container {
              width: 100%;
              text-align: center;
            }

            .text-container {
              width: 100%;
              margin-top: 20px;
              text-align: center;
            }
          }
        `}
      </style>

      <div className="container">
        <div className="image-container">
          <img src='https://tinyurl.com/vhj5skyz' alt='Fitness' />
        </div>
        <div className="text-container">
          <h1>HELLO</h1>
          <p>
            It’s One-on-Wonderful. Here at Crunch, we focus on bringing you the most powerful workouts to meet your needs: our toolbox includes weighted battle ropes, kettlebells, TRX® suspension straps, MMA equipment, Bulgarian Bags, and the list goes on.

            It may sound like a mouthful, but this world-class functional training equipment helps our trainers provide you with an array of High Intensity Interval Training (HIIT) workouts.

            Our Crunch Fitness locations offer HIITZone, an all-encompassing fitness program including personal training, small group training, and nutrition.

            Let’s make a lunge date!
          </p>
        </div>
      </div>
      <div className="container">

        <div className="text-container">
          <h1>HELLO</h1>
          <p>
            It’s One-on-Wonderful. Here at Crunch, we focus on bringing you the most powerful workouts to meet your needs: our toolbox includes weighted battle ropes, kettlebells, TRX® suspension straps, MMA equipment, Bulgarian Bags, and the list goes on.

            It may sound like a mouthful, but this world-class functional training equipment helps our trainers provide you with an array of High Intensity Interval Training (HIIT) workouts.

            Our Crunch Fitness locations offer HIITZone, an all-encompassing fitness program including personal training, small group training, and nutrition.

            Let’s make a lunge date!
          </p>
        </div>
      </div>
    </>
  );
}

export default Example;
